import React from 'react';
import { useLocation } from 'react-router-dom';
import {
	BookedContainer,
	BookedDetails,
	BookedDetailsWrapper,
	BookedList,
	BookedWrapper,
} from './landing.styles';
import Titanic from '../../assets/Titanic.gif';

const LandingPage = () => {
	const location = useLocation();
	console.log(location.state.details);
	return (
		<div className="main">
			<BookedContainer>
				<BookedWrapper>
					<img src={Titanic} alt="Nice gif!" style={{ margin: '10px' }} />
					<h2>Deine Buchung wurde bestätigt! ⚓</h2>
					<BookedDetails>Details:</BookedDetails>
					{location.state ? (
						<React.Fragment>
							<BookedDetailsWrapper style={{ marginBottom: '5px' }}>
								<BookedList>Name: {location.state.details.name}</BookedList>
							</BookedDetailsWrapper>
							<h3 style={{ marginBottom: '5px' }}>Email: {location.state.details.email}</h3>
							<h3 style={{ marginBottom: '5px' }}>Personen: {location.state.details.person}</h3>
							<h3 style={{ marginBottom: '5px' }}>
								Von: {location.state.details.arrivalDate.getDate()}.
								{location.state.details.arrivalDate.getMonth() + 1}.
								{location.state.details.arrivalDate.getFullYear()}
							</h3>
							<h3 style={{ marginBottom: '5px' }}>
								Bis: {location.state.details.departureDate.getDate()}.
								{location.state.details.departureDate.getMonth() + 1}.
								{location.state.details.departureDate.getFullYear()}
							</h3>
						</React.Fragment>
					) : null}
				</BookedWrapper>
			</BookedContainer>
		</div>
	);
};

export default LandingPage;
